import styled from "styled-components";
import React from "react";

const Line = styled.div`
    height: 3px;
    width: 20px;
    background-color: black;
    margin: 2px;
`;
const Burger = () => {
    return (
        <div>
            <Line />
            <Line />
            <Line />
        </div>
    );
};

export default Burger;
